        <style type="text/css">
            html,
            body {
                height: 100%;
                width: 100%;
                margin: 0;
                padding: 0;
            }

            body {
                font-family: "Arial", "Helvetica", sans-serif;
                color: #222;
                font-size: 13px;
                -webkit-tap-highlight-color: rgba(0, 0, 0, 0);
                overflow-y: hidden;
            }


            /* Map styles. */

            #map-container {
                width: 64.9%;
                height: 100%;
                margin-left: auto;
                margin-right: auto;
                position: relative;
                float: right;
                z-index: 0;
            }

            #map-holder {
                height: 100%;
                width: 100%;
            }

            #drop-container {
                display: none;
                height: 100%;
                width: 100%;
                position: absolute;
                z-index: 1;
                top: 0px;
                left: 0px;
                /* padding: 20px;*/
                background-color: rgba(100, 100, 100, 0.5);
            }

            #drop-container.visible {
                display: block;
            }

            #drop-silhouette {
                color: white;
                border: white dashed 8px;
                height: calc(100% - 56px);
                width: calc(100% - 56px);
                background-image: url('data:image/png;base64,');
                background-repeat: no-repeat;
                background-position: center;
                margin: 20px;
            }


            /* Panel styles. */

            #panel {
                float: left;
                width: 35%;
                height: 100%;
                box-shadow: 0 4px 16px rgba(0, 0, 0, 0.2);
                outline: 1px solid rgba(0, 0, 0, 0.2);
                z-index: 100;
            }

            #panel-content {
                padding: 8.5px;
            }

            #geojson-controls {
                padding-bottom: 8px;
            }

            #geojson-input {
                width: 100%;
                -webkit-box-sizing: border-box;
                /* <=iOS4, <= Android  2.3 */
                -moz-box-sizing: border-box;
                /* FF1+ */
                box-sizing: border-box;
                /* Chrome, IE8, Opera, Safari 5.1*/
                border: none;
                resize: none;
                background-color: #F1F1F1;
            }

            #panel-title {
                font-size: 20px;
                line-height: 24px;
                color: #DD4B39;
            }

            .subtitle {
                font-size: 16px;
                color: #222222;
            }

            hr {
                color: #ebebeb;
            }

            #geojson-input {
                background-color: #F1F1F1;
            }

            #geojson-input.invalid {
                background-color: #FAC6C0;
            }
        </style>
